import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { FaPhone, FaCalendarAlt, FaUserMd, FaHeart, FaShieldAlt, FaStar } from 'react-icons/fa';

const Home = () => {
  const services = [
    {
      icon: <FaUserMd className="w-8 h-8" />,
      title: "Diabetic Foot Care",
      description: "Specialized care for diabetic patients with comprehensive foot assessments and treatment."
    },
    {
      icon: <FaHeart className="w-8 h-8" />,
      title: "Nail Care & Treatment",
      description: "Professional nail cutting, trimming, and treatment for various nail conditions."
    },
    {
      icon: <FaShieldAlt className="w-8 h-8" />,
      title: "Skin Treatment",
      description: "Expert care for corns, calluses, dry skin, and other foot skin conditions."
    },
    {
      icon: <FaStar className="w-8 h-8" />,
      title: "Wellness Services",
      description: "Comprehensive foot wellness including massage, education, and preventive care."
    }
  ];

  const testimonials = [
    {
      name: "Sarah M.",
      text: "Sima provided excellent care for my diabetic foot condition. Very professional and caring.",
      rating: 5
    },
    {
      name: "John D.",
      text: "Finally found someone who understands foot care. The clinic is clean and welcoming.",
      rating: 5
    },
    {
      name: "Maria L.",
      text: "Outstanding service! My feet feel so much better after the treatment. Highly recommend.",
      rating: 5
    }
  ];

  return (
    <div>
      {/* Hero Section */}
      <section className="bg-gradient-to-br from-primary to-secondary text-white py-20">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center">
            <motion.h1
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8 }}
              className="text-4xl md:text-6xl font-bold mb-6"
            >
              Healthy Feet, Happy Life
            </motion.h1>
            <motion.p
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.2 }}
              className="text-xl md:text-2xl mb-8 max-w-3xl mx-auto"
            >
              Professional Foot Care & Wellness Services in Calgary, Alberta
            </motion.p>
            <motion.div
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.4 }}
              className="flex flex-col sm:flex-row gap-4 justify-center"
            >
              <Link
                to="/book-appointment"
                className="bg-white text-primary px-8 py-3 rounded-full font-semibold hover:bg-accent transition-colors inline-flex items-center justify-center space-x-2"
              >
                <FaCalendarAlt className="w-5 h-5" />
                <span>Book Appointment</span>
              </Link>
              <a
                href="tel:403-903-4293"
                className="border-2 border-white text-white px-8 py-3 rounded-full font-semibold hover:bg-white hover:text-primary transition-colors inline-flex items-center justify-center space-x-2"
              >
                <FaPhone className="w-5 h-5" />
                <span>Call Now</span>
              </a>
            </motion.div>
          </div>
        </div>
      </section>

      {/* Service Highlights */}
      <section className="py-16 bg-white">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center mb-12">
            <h2 className="text-3xl md:text-4xl font-bold text-text mb-4">
              Our Services
            </h2>
            <p className="text-lg text-gray-600 max-w-2xl mx-auto">
              Comprehensive foot care services designed to keep your feet healthy and comfortable
            </p>
          </div>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
            {services.map((service, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                className="bg-accent rounded-lg p-6 text-center hover:shadow-lg transition-shadow"
              >
                <div className="text-primary mb-4 flex justify-center">
                  {service.icon}
                </div>
                <h3 className="text-xl font-semibold text-text mb-3">
                  {service.title}
                </h3>
                <p className="text-gray-600 mb-4">
                  {service.description}
                </p>
                <Link
                  to="/services"
                  className="text-primary font-medium hover:text-secondary transition-colors"
                >
                  Learn More â†’
                </Link>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Testimonials */}
      <section className="py-16 bg-accent">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="text-center mb-12">
            <h2 className="text-3xl md:text-4xl font-bold text-text mb-4">
              What Our Patients Say
            </h2>
            <p className="text-lg text-gray-600">
              Real experiences from our valued patients
            </p>
          </div>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            {testimonials.map((testimonial, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.6, delay: index * 0.1 }}
                className="bg-white rounded-lg p-6 shadow-md"
              >
                <div className="flex mb-4">
                  {[...Array(testimonial.rating)].map((_, i) => (
                    <FaStar key={i} className="w-5 h-5 text-yellow-400" />
                  ))}
                </div>
                <p className="text-gray-600 mb-4 italic">
                  "{testimonial.text}"
                </p>
                <p className="font-semibold text-text">
                  - {testimonial.name}
                </p>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="py-16 bg-primary text-white">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 text-center">
          <h2 className="text-3xl md:text-4xl font-bold mb-4">
            Ready to Take Care of Your Feet?
          </h2>
          <p className="text-xl mb-8 max-w-2xl mx-auto">
            Book your appointment today and take the first step towards healthier, happier feet.
          </p>
          <Link
            to="/book-appointment"
            className="bg-white text-primary px-8 py-3 rounded-full font-semibold hover:bg-accent transition-colors inline-flex items-center space-x-2"
          >
            <FaCalendarAlt className="w-5 h-5" />
            <span>Schedule Your Visit</span>
          </Link>
        </div>
      </section>
    </div>
  );
};

export default Home;
